    [],nt"revision_timestamp": "2016-07-27T22:24:56.099923",nt"name": "wheeler-national-wildlife-refuge-annual-narrative-report-calendar-year-2001",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Wheeler,
    Watercress Darter, Fern Cave, Key Cave, and Sauta Cave National Wildlife Refuges
    covers refuge activities during the 2001 calendar year. The report begins with an
    introduction to the Refuge. Highlights and weather conditions are summarized for
    the year. Information about monitoring and studies- including surveys and censuses
    and studies and investigations- is provided next. Habitat restoration and management
    projects are also covered; activities include wetland restoration, upland restoration,
    moist soil management, mowing, farming, prescribed burning, and vegetation control.
    Fish and wildlife management are discussed next with emphasis on bird banding, disease
    monitoring, nest structures, and animal control. Coordination activities, such as
    interagency coordination and private land activities, are outlined. The resource
    protection section provides an update on law enforcement, wildfire preparedness,
    permits, contaminant investigation, cultural resource management, and land acquisition
    support. Information about public education and recreation is given including visitor
    services and outreach. Finally, comprehensive management planning and general administration
    are discussed in the Refuge planning and administration section.",nt"license_title":
